constexpr uint32_t MakePacketCallId(uint16_t family, uint16_t api_call)
{
    return ((static_cast<uint32_t>(family) << 16) & 0xffff0000) | (static_cast<uint32_t>(api_call) & 0x0000ffff);
}

constexpr uint16_t GetPacketCallFamily(uint32_t call_id)
{
    return static_cast<uint16_t>((call_id >> 16) & 0x0000ffff);
}

enum PacketFamilyId : uint16_t
{
    PacketFamily_None                   = 0,
    PacketFamily_Vulkan_Functional_Call = 1,
    PacketFamily_META_DATA_Call         = 2,
};

